Ingredients in my Best Vanilla Cake recipe
Here‚Äôs what you need to make this plush, soft vanilla cake. No cake flour, no buttermilk, no sour cream. Tried them all ‚Äì this cake is better with plain / all purpose flour and just milk.

Ingredients in the BEST Vanilla cake - NO cake flour, NO buttermilk
Plain / all purpose flour ‚Äì compared to cake flour, the flavour of the butter and vanilla comes through better, the crumb is slightly more velvety AND it keeps slightly more moist too. Bonus: no need to hunt down / pay a premium for cake flour! Do not substitute with self raising flour or gluten free flour.

Eggs ‚Äì whipped to aerate, these are key to make the cake extraordinarily light and fluffy. You don‚Äôt get an eggy flavour;

Baking powder ‚Äì not baking soda (bi-carb), it doesn‚Äôt rise as well. This is our safety net, extra helping hand to make the cake rise.

Milk, full fat ‚Äì just plain cow milk. Low fat works as well but rises marginally less. Do not substitute with non dairy milk or buttermilk;

Sugar ‚Äì best to use caster / superfine sugar if you can because it dissolves better in the eggs. But regular / granulated sugar works just fine too ‚Äì you may just end up with some little brown spots on the base;

Oil ‚Äì just 1 tablespoon adds a noticeable hint of extra moistness, especially on Day 4, without weighing down the cake in the slightest. Don‚Äôt be tempted to add more ‚Äì I tried an extra tablespoon and it didn‚Äôt rise as well;

Vanilla extract  ‚Äì the best you can afford. Imitation will work just fine, but the flavour isn‚Äôt as pure or real. I use Queen Vanilla Extract. Don‚Äôt waste your money on vanilla beans or vanilla bean paste ‚Äì it‚Äôs not worth it for cakes.
